 INSERT INTO srdb.assessment VALUES('DFO-SG-COD4TVn-1965-2007-PREFONTAINE', 'DFO-SG', 'COD4TVn', 'PREFONTAINE', '2008-05-28', '2009-06-08 14:56:44', '1965-2007', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'contact details ', 'this is a test entry only', '', 1, 1, 'ADAPT', 'Two different models were used to assess the NAFO 4TVn cod stock; these models took into account different mortalities which can both be found as a time series. The TAC of this stock was 4000 MT in 2006. The value of Bcrp was chosen in the 2003 assessment of this stock (Chouinard et al. 2003) and represents an estimate of various methods. ', '../spreadsheets/PREFONTAINE-COD4TVn-2007-editedDR-QAQC.xls') ; 
